  <AppLayout>
    <Head>
      <title>NTB</title>
    </Head>
    <Space direction="vertical" size={16}>
      <Card
        size="small"
        title="오늘의 운동"
        extra={<a href="#">More</a>}
        style={{
          width: 300,
        }}
      >
        <p>Card content</p>
        <p>Card content</p>
        <p>Card content</p>
      </Card>
    </Space>
  </AppLayout>
);

export default Home;
